pragma solidity ^0.5.0;

contract SimpleStorage {

    //structure of document
    struct Document {
        uint idDoc;
        bytes32 name;
        bytes32 hash1;
        bytes32 hash2;
    }

    struct User {
        uint id;
        bytes32 name;
        Document[] userDocuments;
    }

    struct NUser{
        uint id;
        bytes32 name;
        bytes32 [] idDoc;
        bytes32 [] nameDoc;
        bytes32 [] hashDoc;
    }

    Document[] public allDocuments;
    User[] public allUsers;

    //registered users
    uint[] users = [15447, 15448, 15449];

    Document public soyPdf1 = Document(111, "soyPdf1", "A1111", "1000");
    Document public soyPdf2 = Document(222, "soyPdf2", "A2222", "2000");

    function validateDocuments(uint _idDoc, bytes32 _name, bytes32 _hash1, bytes32 _hash2) public returns (uint, bytes32, bytes32, bytes32) {

        for (uint i = 0; i < allDocuments.length; i++) {
            Document memory docToCompare  = allDocuments[i];
            if(_idDoc == docToCompare.idDoc){
                if( _hash1 == docToCompare.hash1 && _hash2 == docToCompare.hash2){
                    //Documento Sin alterar
                    return (5, "0x555","0x555", "0x555");
                }else{
                    //Documento fue alterado
                    return (4, "0x444","0x444", "0x444");
                }
            }
        }
        //El Documento no ha sido registrado
        return (6, "0x666","0x666", "0x666");
    }

    function addDocuments(uint _idDoc, bytes32 _name, bytes32 _hash1, bytes32 _hash2) public returns (uint, bytes32, bytes32, bytes32) {

        for (uint i = 0; i < allDocuments.length; i++) {
            Document memory docToCompare  = allDocuments[i];
            if(_idDoc == docToCompare.idDoc){
                //Documento ya se encuentra inscrito
                return (2, "0x222","0x222", "0x222");
            }
            if(_hash1 == docToCompare.hash1 && _hash2 == docToCompare.hash2){
                //El hash ya se encuentra registrado
                return (3, "0x333","0x333", "0x333");
            }
        }

        Document memory tempDoc = Document({
            idDoc: _idDoc,
            name: _name,
            hash1: _hash1,
            hash2: _hash2
            });
        allDocuments.push(tempDoc);
        return (tempDoc.idDoc, tempDoc.name, tempDoc.hash1, tempDoc.hash2);
    }

    function login(uint _personId) public returns (uint, bytes32, uint[] memory, bytes32[] memory, bytes32[] memory, bytes32[] memory){
        for (uint y = 0; y < users.length ; y++){
            if(users[y] == _personId){

                addDocuments(123, "soy Pdf4", "QmYJhQipMiizfRCbYDsdCP4", "QMF5vnRjc7yiYEjSPimZ1fy" );
                addDocuments(456, "soy Pdf1", "QmYfMzd2oHHrBjq2vFQaTsD", "MTRSSheJyk94Tm5Fok8QEVs" );
                User memory tempUser  = User({
                    id: 756,
                    name: "Sergio",
                    userDocuments: allDocuments
                    });

                uint indexLength = allDocuments.length;

                uint[]    memory iddocs = new uint[](indexLength);
                bytes32[] memory names = new bytes32[](indexLength);
                bytes32[] memory hashes1 = new bytes32[](indexLength);
                bytes32[] memory hashes2 = new bytes32[](indexLength);

                for (uint i = 0; i < indexLength; i++) {
                    Document storage document = allDocuments[i];
                    iddocs[i] = document.idDoc;
                    names[i] = document.name;
                    hashes1[i] = document.hash1;
                    hashes2[i] = document.hash2;
                }

                return (tempUser.id, tempUser.name, iddocs, names, hashes1, hashes2);

            }
        }

        uint[]    memory iddocs;
        bytes32[] memory names;
        bytes32[] memory hashes1;
        bytes32[] memory hashes2;


        return (1, "0x111", iddocs, names, hashes1, hashes2);
    }

    string ipfsHash = 'prueba';

    function set(string memory x) public {
        ipfsHash = x;
    }

    function get() public view returns (string memory) {
        return ipfsHash;
    }

    function saveInfo(uint _idDoc, bytes32 _name, bytes32 _hash1, bytes32 _hash2) public returns (bool){
        addDocuments(_idDoc, _name, _hash1, _hash2 );
        return (true);
    }


}
